import React, { useState, useEffect } from 'react';
import { FlatList, Text, View, StyleSheet, TouchableOpacity } from 'react-native';
import axios from 'axios';
import FlatListItem from '../components/FlatlistItem';
import { useTheme } from '../components/ThemeContext';
import { scheduleNotificationAsync } from 'expo';

export function Vazamento() {
  const [data, setData] = useState([]);
  const { isDarkMode } = useTheme();
  const styles = isDarkMode ? darkStyles : lightStyles;

  useEffect(() => {
    fetchData();
  }, [data]);

  const sendNotification = async () => {
    try {
      await scheduleNotificationAsync({
        content: {
          title: 'Título da Notificação',
          body: 'Corpo da Notificação',
        },
        trigger: null, // Dispara imediatamente
      });
    } catch (error) {
      console.error('Erro ao enviar notificação:', error);
    }
  };

  const fetchData = async () => {
    try {
      const response = await axios.get('http://192.168.15.2:3000/alert');
      const newData = response.data;
      if (newData.length > data.length) {
        // Envia uma notificação se novos dados foram adicionados
        sendNotification();
      }
      setData(newData);
    } catch (error) {
      console.error('Erro ao buscar dados da API:', error);
    }
  };

 
  

  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.headerText}>Total de Vazamentos: {data.length}</Text>
      </View>
      <View style={styles.passwordListContainer}>
        {data.length > 0 ? (
          <FlatList
            data={data}
            renderItem={({ item }) => <FlatListItem data={item} />}
            keyExtractor={(item) => item.id.toString()}
          />
        ) : (
          <Text>Nenhum dado disponível</Text>
        )}
      </View>
    </View>
  );
};


const darkStyles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#232323', // Set the background color for the entire component
  },
  header: {
    backgroundColor: '#232323',
    paddingTop: 58,
    paddingLeft: 14,
    paddingRight: 14,
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  headerText: {
    color: '#ffffff',
    fontSize: 20,
  },
  deleteAllText: {
    color: '#ffffff',
  },
  passwordListContainer: {
    marginTop: 10,
  },
  modalContainer: {
    backgroundColor: 'rgba(24,24,24,0.6)',
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  modalContent: {
    backgroundColor: '#2e2e2e',
    width: '85%',
    paddingTop: 24,
    paddingBottom: 24,
    alignItems: 'center',
    justifyContent: 'center',
    borderRadius: 8,
  },
  modalTitle: {
    fontSize: 20,
    color: '#ffffff',
    marginBottom: 10,
  },
  modalSubtitle: {
    fontSize: 15,
    fontWeight: '900',
    color: '#ffffff',
    marginBottom: 10,
  },
  buttonArea: {
    flexDirection: 'row',
    gap: 50,
  },
  modalButton: {
    marginTop: 15,
    paddingTop: 15,
    paddingBottom: 15,
    paddingHorizontal: 20,
  },
  modalButtonSave: {
    backgroundColor: '#ffffff',
    borderRadius: 8,
  },
  modalButtonText: {
    color: '#000000',
    fontWeight: 'bold',
  },
});
const lightStyles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#eee', 
  },
  header: {
    backgroundColor: '#rgba(24,24,fff,0.6)',
    paddingTop: 58,
    paddingLeft: 14,
    paddingRight: 14,
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  headerText: {
    color: '#000000',
    fontSize: 20,
  },
  deleteAllText: {
    color: '#000000',
  },
  passwordListContainer: {
    marginTop: 15,
  },
  modalContainer: {
    backgroundColor: 'rgba(24,24,24,0.6)',
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  modalContent: {
    backgroundColor: '#fff',
    width: '85%',
    paddingTop: 24,
    paddingBottom: 24,
    alignItems: 'center',
    justifyContent: 'center',
    borderRadius: 8,
  },
  modalTitle: {
    fontSize: 20,
    color: '#000',
    marginBottom: 10,
  },
  modalSubtitle: {
    fontSize: 15,
    fontWeight: '900',
    color: '#000',
    marginBottom: 10,
  },
  buttonArea: {
    flexDirection: 'row',
    gap: 50,
  },
  modalButton: {
    marginTop: 15,
    paddingTop: 15,
    paddingBottom: 15,
    paddingHorizontal: 20,
  },
  modalButtonSave: {
    backgroundColor: '#0e0e0e',
    borderRadius: 8,
  },
  modalButtonText: {
    color: '#000',
    fontWeight: 'bold',
  },
  header: {
    backgroundColor: '#eee',
    paddingTop: 58,
    paddingBottom: 14,
    paddingLeft: 14,
    paddingRight: 14,
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  headerText: {
    color: '#000000',
    fontSize: 20,
  },
});
